import Link from 'next/link';

const Detail = () => {
  return (
    <div>
      <Link as='/car/trang' href='/[vehicle]/[person]'>
        <a>NAVIGATE TO OTHER PAGE</a>
      </Link>
    </div>
  );
};

export default Detail;
